sap.ui.define([
	"VIEWER/PDF/controller/BaseController",
	"sap/ui/model/json/JSONModel",
	"sap/ui/core/util/File"

], function (BaseController, JSONModel, File) {
	"use strict";

	return BaseController.extend("VIEWER.PDF.controller.View1", {
		onInit: function () {
			var oViewModel = new JSONModel({

			});

			this.setModel(oViewModel, "claimsView");
			this.setModel(new JSONModel(), "claim");

			var url = jQuery.sap.getModulePath("VIEWER.PDF") + "/model/data.json";
			var oJsonModel = new JSONModel(url);
			this.getView().setModel(oJsonModel);
			this.getView().addStyleClass(this.getOwnerComponent().getContentDensityClass());

			var data =
				"";
			var bin = atob(data);

			var oHtml = this.getView().byId("idFrame");
			oHtml.setContent(
				"<iframe src='data:application/pdf;base64,' height='700' width='1300'></iframe>"
			);

		},

		onOpen: function () {
			var string =
				"data:application/pdf;base64,";
			// var string = doc.output('datauristring');
			var iframe = "<iframe width='100%' height='100%' src='" + string + "'></iframe>";
			var x = window.open();
			x.document.open();
			x.document.write(iframe);
			x.document.close();

			// var fileURL =
			// 	"data:application/pdf;base64,";
			// window.open(fileURL);
		},

		onSave: function () {
			var data =
				"";
			var bin = atob(data);

			sap.ui.core.util.File.save(bin, "filename", "pdf", "application/pdf");

		}
	});
});